You may recognize some of these bird images - they are by my friend and NatGeo colleague @TimLaman, well-known for photographing the Birds-of-Paradise, Hornbills, and other bird-themed stories for NatGeo, but who also makes striking bird images right in his backyard.  If you are interested in bird photography, now is your chance to learn from Tim.  He has just created a new online masterclass called "The Creative Process in Bird Photography", dedicated to helping other photographers achieve their potential by learning to focus on the creative aspects of wildlife photography. 

Head over to @TimLaman and follow the link in his bio to learn more.  He is offering the course at a special introductory price, so now is the time to check it out.

@TimLaman #birdphotographymasterclass #birdsofparadise #hornbills #birds #masterclass #birdphotography

Bonobo Matriarchy: Family Grooming

In the world of bonobos, females hold the power. They form high-ranking groups, supported by their sons, and maintain a unique social structure. Grooming rituals, like this gathering on a fallen tree, are vital for strengthening these bonds.

Photographing wild bonobos is a rare opportunity. They exclusively inhabit the lush tropical forests on the southern side of the Congo River in Central Africa in DRC. Lui Kotale Bonobo Project is one of the few places where we have the priviledge to witness bonobos in the wild.

For nearly three decades, German researchers from the Max-Planck-Institute for Animal Behavior, Barbara Fruth and her husband Gottfried Hohmann, have delved into the lives of these incredible creatures, with 18 of those years at Lui Kotale.

Join us on this journey of discovery and conservation.

Follow us for more:

