This is an amazing opportunity to inform more people know about bonobos, their behavior and how threatened they are in the wild! This image was only possible by working closely with Barbara Fruth and her excellent research team at the Max-Planck Institute for Animals Behavior in Konstanz and the LuiKotale Bonobo Project in Democratic Republic of Congo. 

